    const demoProps = {
        bg: 'var(--mantine-color-blue-light)',
        h: 50,
        width: "100",
        mt: 'md',
      };
  return (
    <Container
    {...demoProps}
    >
      App Bar
    </Container>
  );
};

export default AppBar;
